class Solution {
    func countCompleteSubstrings(_ word: String, _ k: Int) -> Int {
        let n = word.count
        var ans = 0
        let word = Array(word)

        for i in 0..<n {
            var freq = [Character: Int]()
            var minChar = Character("z"), maxChar = Character("a")
            for j in i..<n {
                freq[word[j], default: 0] += 1
                if word[j] < minChar {
                    minChar = word[j]
                }
                if word[j] > maxChar {
                    maxChar = word[j]
                }
                if freq.count > 2 || maxChar.asciiValue! - minChar.asciiValue! > 2 {
                    break
                }
                if freq.allSatisfy({ $0.value == k }) {
                    ans += 1
                }
            }
        }
        return ans
    }
}
